window.bookSummaryJSON = "<p><i>The Wild Hunt</i> is on the trail of the Tuathan Brotherhood - a hate group terrorizing humans and shifters alike. Their investigation takes them over to the Olympic Peninsula, where they plunge into the heart of the haunted old-growth forest in a desperate attempt to stop the group before they strike again. </p> <p>Meanwhile, one of Herne's friends turns to the Wild Hunt. He's unwittingly unleashed a terrifying spirit who threatens Port Ludlow with the fury of her storms. Now, they must not only locate Rafe, who has vanished while undercover in the forest, but they must also appease the Cailleach before she destroys the entire community and everyone within it.</p>"; 
